            <h1>Yoga Application Form</h1>
          </div>
          <div class="item">
            <p>Select Course Date</p>
            <input type="date" name="bdate" required />
            <i class="fas fa-calendar-alt"></i>
          </div>
          <div class="item">
            <p>Name</p>
            <div class="name-item">
              <input type="text" name="name" placeholder="First" />
              <input type="text" name="name" placeholder="Last" />
            </div>
          </div>
          <div class="item">
            <p>Email</p>
            <input type="email" name="email" />
          </div>
          <div class="item">
            <p>Phone</p>
            <input type="text" name="phone" placeholder="### ### ####" />
          </div>
          <div class="question">
            <p>Gender</p>
            <div class="question-answer">
              <div>
                <input type="radio" value="none" id="radio_1" name="gender" />
                <label for="radio_1" class="radio">
                  <span>Male</span>
                </label>
              </div>
              <div>
                <input type="radio" value="none" id="radio_2" name="gender" />
                <label for="radio_2" class="radio">
                  <span>Female</span>
                </label>
              </div>
            </div>
          </div>
          <div class="item">
            <p>Language</p>
            <input type="text" name="language" />
          </div>
          <div class="item">
            <p>Address</p>
            <input
              type="text"
              name="name"
              placeholder="Street address"
              required
            />
            <input
              type="text"
              name="name"
              placeholder="Street address line 2"
              required
            />
            <div class="city-item">
              <input type="text" name="name" placeholder="City" required />
              <input type="text" name="name" placeholder="Region" required />
              <input
                type="text"
                name="name"
                placeholder="Postal / Zip code"
                required
              />
              <select required>
                <option value="">Country</option>
                <option value="1">Russia</option>
                <option value="2">Germany</option>
                <option value="3">France</option>
                <option value="4">Armenia</option>
                <option value="5">USA</option>
              </select>
            </div>
          </div>
          <div class="item">
            <p>Experience in Yoga</p>
            <textarea rows="3"></textarea>
          </div>
          <div class="item">
            <p>Illness (if any)</p>
            <input type="text" name="illness" />
          </div>
          <div class="item">
            <p>Additional Message</p>
            <textarea rows="3"></textarea>
          </div>
          <div class="btn-block">
            <button type="submit" href="/">
              Send Application
            </button>
          </div>
        </form>
      </div>
    </body>

